import React from "react";

export default function Listing() {
  return (
    <div className="container" style={{ maxWidth: "75vw", float: "right" }}>
      <div className="card p-3 w-100">
        <div className="row">
          <div className="col">
            <div
              className="productlist p-2"
              style={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center"
              }}
            >
              <img src="smart tv.webp" />
              <p className="p-0">smart tv</p>
              <p className="p-0">$999</p>
              <p className="p-0">$99</p>
            </div>
          </div>
      </div>
     </div>
     </div>
  );
}
